}


/************************* wrapper ***************************/
.wrapper {
    display: flex;
    @include box_array;
    margin-bottom: 120px;

    .side_filter {
        flex: 0 0 auto;
        width: 315px;

        >div {
            margin-right: 105px;
            padding: 20px 0;
            border-bottom: 1px solid gray;

            &:first-child {
                padding: 0 !important;
            }

            &:last-child {
                border: none;
            }

            .info_title {
                margin-bottom: 10px;
                letter-spacing: -0.2px;
            }
        }

        .menu_list_section {
            .menu_title {
                font-size: 2.4rem;
                padding: 15px 0;
                border-bottom: 4px solid black;
            }

            .product_menu_list {
                font-size: $small_up_font_size;
                font-family: $font_noto_sans;
                font-weight: 700;
                padding: 20px 0;

                li {
                    user-select: none;
                    margin-bottom: 10px;
                    cursor: pointer;
                    color: gray;
                    transition: all 0.1s;
                    &:last-child {
                        margin-bottom: 0;
                    }

                }
            }
        }

        .color_select {
            ul {
                display: flex;

                li {
                    @include item_size(20px, 20px);
                    cursor: pointer;
                    margin-right: 15px;
                    margin-bottom: 15px;
                    &.black_box {
                        background-color: black;
                    }
                    &.white_box {
                        background-color: white;
                        border: 1px solid #bbbbbb;
                    }
                    &.gray_box {
                        background-color: gray;
                    }
                    &.brown_box {
                        background-color: burlywood;
                    }
                    &.blue_box {
                        background-color: rgb(0, 81, 255);
                    }
                    &.sky_blue_box {
                        background-color: skyblue;
                    }
                    &.green_box {
                        background-color: rgb(9, 163, 9);
                    }
                    &.green_down_box {
                        background-color: rgb(16, 90, 16);
                    }
                    &.orange_box {
                        background-color: orange;
                    }
                    &.pink_box {
                        background-color: pink;
                    }
                    &.purple_box {
                        background-color: rgb(155, 13, 155);
                    }
                }
            }
        }

        .price_select {
            label {
                margin-bottom: 10px;
                letter-spacing: -0.2px;
            }
        }

        .sale_select {
            label {
                margin-bottom: 10px;
                letter-spacing: -0.2px;
            }
        }

        .label_style {
            .chk_box {
                display: inline-block;
                width: 15px; height: 15px;
                transform: translateY(2px);
                background-color: white;
                margin-right: 4px;
                border: 1px solid gray;
                transition: all 0.2s;
            }
        }
        input {
            &:checked {
                ~ .chk_box {
                    background-image: url(../dist/images/check_icon.png);
                    @include background_contain;
                }
            }
        }
        .filter_section {
            display: none;
        }
    }

    .product_container {
        flex: 0 0 auto;
        width: 930px;
        margin-left: 15px;

        .product_filter_top {
            margin: 20px 0;
            overflow: hidden;

            .gender_tab_area {
                float: left;

                button {
                    position: relative;
                    color: gray;
                    font-size: $defalut_font_size;
                    font-family: $font_noto_sans;
                    background: none;
                    margin-right: 15px;
                    letter-spacing: -0.5px;

                    &.male::after,
                    &.female::after {
                        content: "";
                        position: absolute;
                        top: 6px;
                        left: 38px;
                        width: 1px;
                        height: 15px;
                        background-color: gray;

                    }

                    &.tab_on {
                        color: black;
                    }
                }
            }

            .sort_n_filter_btn_toggle_area {
                float: right;
                display: flex;

                .sort_style {
                    font-size: $small_up_font_size;
                    font-family: $font_noto_sans;
                    font-weight: 700;
                    margin-left: 15px;
                }

                .filter_btn {
                    cursor: pointer;
                    .filter_chk_design {
                        transform: translateY(-4px);
                        margin-right: 5px;
                    }

                    .filter_toggle_bar {
                        position: relative;
                        display: inline-block;
                        @include item_size(70px, 20px);
                        background-color: #bbbbbb;
                        border-radius: 15px;
                        transition: all 0.5s;
                        .move_bar {
                            position: absolute;
                            top:0; left: 0px;
                            @include item_size(20px, 20px);
                            transition: all 0.5s;
                            background-color: #fff;
                            border:1px solid gray;
                            border-radius: 50%;
                        }
                    }

                    &.filter_on {
                        .filter_toggle_bar {
                            background-color: black;
                        }
                        .move_bar {
                            left: 50px;
                        }
                    }
                }

                select {
                    @include item_size(100px, 20px);
                    transform: translateY(-1px);
                    border: none;
                }
                label {
                    display: inline-block;
                }
            }
        }
        .product_list_wrapper {
            overflow: hidden;
            li {
                position: relative;
                float: left;
                margin-right: 15px;
                @include item_size(300px, 600px);
                &:nth-child(3n) {
                    margin-right: 0;
                }
                .img_link_01 {
                    position: absolute;
                    top: 0;
                    transition: all 0.3s;
                    opacity: 1;
                    &:hover {
                        opacity: 0;
                    }
                    img {
                        object-fit: cover;
                    }
                }
                .img_link_02 {
                    img {
                        object-fit: cover;
                    }
                }
/*                 img {
                    @include item_size(300px, 330px);
                } */
                .product_name {
                    font-size: $small_up_font_size;
                    font-family: $font_noto_sans;
                    font-weight: 700;
                    margin-top: 6px;
                }
                .model_name {
                    font-size: $small_up_font_size;
                    font-family: $font_noto_sans;
                }
                .price {
                    display: inline-block;
                    font-size: 18px;
                    font-family: $font_noto_sans;
                    margin-bottom: 60px;
                }
                .price_unit {
                    font-size: 20px;
                    margin-right: 2px;
                }
                .best, .new {
                    display: inline-block;
                    margin-top: 6px;
                    margin-right: 5px;
                    font-size: $small_up_font_size;
                    font-weight: 700;
                }
                .best {
                    color: #8e2720;
                    animation: best 0.8s infinite;
                }
                .new {
                    color: #4136BF;
                    animation: new 0.8s 0.4s infinite;
                }
                @keyframes best {
                    50% {
                        color: #d88f8a;
                    }
                    100% {
                        color: #b92d23;
                    }
                }
                @keyframes new {
                    50% {
                        color: #938beb;
                    }
                    100% {
                        color: #4136BF;
                    }
                }
            }
        }
    }
}
